import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <video src="/img/Joann_Home_Logo.mp4" type="video/mp4" width="500" height="500" autoplay>
        </video>
        <a
          className="Main Page"
          href="/public/index.html"
          target="_blank"
          rel="noopener noreferrer"
        >
          Enter My Website
        </a>
      </header>
    </div>
  );
}

export default App;
